import React, { Component } from 'react'

export class AddTodo extends Component {
    render() {
        return (
            <form style={{ display: 'flex' }}>
                <input 
                    type='text' 
                    placeholder='Add Todo...'
                    style={{ flex: '10' }}
                />
                <input 
                    type='submit'
                    // style={{ flex: '0.1' }}
                />
            </form>
        )
    }
}

export default AddTodo
